#### uuCmd documentation
https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-34df77ebe0a04adda6dcd62d32c4f513/book/page?code=sysInitAsid_00

#### Input
```javascript
{ 
  // attributes which will be stored in SysAppConfig uuObject; 
  runtimeMode: {
    mode: "standard"    //code of the runtime mode (privileged/standard)
  }
  ... // other attributes
};
```
#### Validation schema
```javascript
shape({
  runtimeMode: sysSetAppRuntimeModeDtoInType()
},NOSTRICT,16000) 
```
#### Output
```javascript
{
  ... // uuObject sysAppConfig
  uuAppErrorMap: {} // uuApp standard errorMap
};
```

#### uuCmd documentation
https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-34df77ebe0a04adda6dcd62d32c4f513/book/page?code=sysInitAppWorkspace_00
#### Input
```javascript
{
  awid: "...",                            //unique id of uuAppWorkspace specied externaly
  awidOwner: "...",                       //uuIdentity of uuAppWorkspace AwidOwner uuEE
  licenseOwner: {                         //information about uuAppWorkspace license
    organization: {                       //only if the license is owned by organisation
      name: "...",                        //name of the organization
      oId: "...",                         //unique id of organization in plus4u
      web: "..."                          //uri of the web page of organization
    },
    userList: [                           //array of competent persons; at least one person is mandatory
      {
        uuIdentity: "...",                //unique identifier of user in plus4u
        name: "..."                       //whole name of the user (first name + surname)
      }
    ]
  },
  runtimeMode: { 
    mode: "standard",                     //code of the awid runtime mode (standard/privileged), default to standard.
    note: "AWID migration",               //reason for setting the runtime mode
    to: "2018-06-21T10:15:30.000Z"        //expected time to which the mode is set (ISO 8601 date format)
  }
};
```
#### Validation schema
```javascript
shape({
  awid: hex32code().isRequired(),
  awidOwner: uuIdentity().isRequired(),
  licenseOwner: shape({  
    organization: shape({
      name: uu5String(4000).isRequired(),
      oId: code().isRequired(),
      web: uri()
    }),
    userList: array(
      shape({
        uuIdentity: uuIdentity().isRequired(),
        name: uu5String(4000).isRequired(),
      }), 1, 30
    ).isRequired()
  }).isRequired(),
  runtimeMode: shape({
    mode: oneOf(["standard","privileged"]).isRequired(),
    note: uu5String(),
    to: datetime()
  })
}) 
```
#### Output
```javascript
{
  uuAppErrorMap: {} //uuApp standard errorMap
};
```

#### uuCmd documentation
https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-34df77ebe0a04adda6dcd62d32c4f513/book/page?code=sysSetProfile_00

#### Input
```javascript
{
  code: "Authorities", // profile code; must be set
  roleUri: "ues:[84723967990075193]:[74309394208653707]" //URI of role (global group All - urn:uu:GGALL; global group All from Plus4U - urn:uu:GGPLUS4U)
                                                         //If null uri (ues:[-1]:[-1]) is set, roleUri is set to nill
};
```
#### Validation schema
```javascript
shape({
  code: code().isRequired(),
  roleUri: uri().isRequired()
}) 
```
#### Output
```javascript
{
  ... // uuObject sysProfile
  uuAppErrorMap: {} // standard uuAppErrorMap
};
```

#### uuCmd documentation
https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-34df77ebe0a04adda6dcd62d32c4f513/book/page?code=sysCreatePermission_00

#### Input
```javascript
{
  profileCode: "authorities", // profile code; must be set
  uuIdentityList: ["1-1", "101-1"], // string or array of strings with identity uuIdentities; must be set; max 10 items
  ttl: 1800 // allows to create temporary permission (will be automatically removed after specified time in seconds)
};
```
#### Validation schema
```javascript
shape({
  profileCode: code().isRequired(),
  uuIdentityList: oneOf([uuIdentity(), array(uuIdentity(), 1, 10)]).isRequired(),
  ttl: integer()
}) 
```
#### Output
```javascript
{
  itemList: [ // array of created permissions
    {} // uuObject sysPermission
  ],
  uuAppErrorMap: {} // standard uuAppErrorMap
};
```

#### uuCmd documentation
https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-34df77ebe0a04adda6dcd62d32c4f513/book/page?code=sysSetAppRuntimeMode_00

#### Input
```javascript
{ 
  mode: "privileged",                        //code of the runtime mode (standard/privileged)
  note: "Migration to version 2.0",          //reason for setting the runtime mode
  to: "2018-06-21T10:15:30.000Z"             //expected time to which the mode is set (ISO 8601 date format)
};
```
#### Validation schema
```javascript
shape({
  mode: oneOf(["standard","privileged"]).isRequired(),
  note: uu5String(),
  to: datetime()
}) 
```
#### Output
```javascript
{
  uuAppErrorMap: {} //uuApp standard errorMap
};
```

