#### Input
```javascript
{
  awid: "...",                            //unique id of uuAppWorkspace specied externaly
  awidOwner: "...",                       //uuIdentity of uuAppWorkspace AwidOwner uuEE
  licenseOwner: {                         //information about uuAppWorkspace license
    organization: {                       //only if the license is owned by organisation
      name: "...",                        //name of the organization
      oId: "...",                         //unique id of organization in plus4u
      web: "..."                          //uri of the web page of organization
    },
    userList: [                           //array of competent persons; at least one person is mandatory
      {
        uuIdentity: "...",                //unique identifier of user in plus4u
        name: "..."                       //whole name of the user (first name + surname)
      }
    ]
  },
  runtimeMode: { 
    mode: "standard",                     //code of the awid runtime mode (standard/privileged), default to standard.
    note: "AWID migration",               //reason for setting the runtime mode
    to: "2018-06-21T10:15:30.000Z"        //expected time to which the mode is set (ISO 8601 date format)
  }
};
```
#### Validation schema
```javascript
shape({
  awid: hex32code().isRequired(),
  awidOwner: uuIdentity().isRequired(),
  licenseOwner: shape({  
    organization: shape({
      name: uu5String(4000).isRequired(),
      oId: code().isRequired(),
      web: uri()
    }),
    userList: array(
      shape({
        uuIdentity: uuIdentity().isRequired(),
        name: uu5String(4000).isRequired(),
      }), 1, 30
    ).isRequired()
  }).isRequired(),
  runtimeMode: shape({
    mode: oneOf(["standard","privileged"]).isRequired(),
    note: uu5String(),
    to: datetime()
  })
}) 
```
#### Output
```javascript
{
  uuAppErrorMap: {} //uuApp standard errorMap
};
```

